n: 1, //怎么显示 ×\n              content: $(\'.laybox2\')\n            })\n          else layer.msg(res.data.data)\n\n        }).catch(err => { })\n    },\n    rejres (id) {\n      this.$axios.post(\'admin/AgentIncRation/showRea\', {\n        token: this.token,\n        id: id\n      })\n        .then(res => {\n          layer.open({\n            type: 0,\n            area: [\'30%\', \'30%\'],\n            title: [\'物料配给驳回理由\', \'height:60px;background-color:#98D1F9;color:white;text-align:center;font-size:20px;line-height:60px;\'],\n            shadeClose: true,\n            shade: 0.8,\n            content: res.data.data\n          })\n        })\n    }\n  },\n  created () {\n    this.init();\n  },\n  mounted () {\n    var id = this.$route.query.id;\n    this.curId = id;\n    this.$axios.post(\'admin/Auth/erAuth\', {\n      token: window.sessionStorage.getItem(\'bbytoken\'),\n      id: id\n    })\n      .then(res => {\n\n        if (res.data.code == 1) {\n          var arr = res.data.data;\n          for (var i = 0; i < arr.length; i++) {\n            if (arr[i].son) {\n              if (arr[i].name == \'增加地区\') {\n                this.seCurId = arr[i].id;\n                this.threeAuthList = arr[i].son;\n              }\n              for (var j = 0; j < arr[i].son.length; j++) {\n                if (arr[i].action != arr[i].son[j].action) {\n                  arr[i].action = arr[i].son[0].action;\n                }\n                if (arr[i].son[j].name == \'驳回列表\' && arr[i].name == \'增加地区\') {\n                  this.thCurId = arr[i].son[j].id;\n                }\n              }\n            }\n          }\n          this.authList = arr;\n        } else {\n          this.$alert(res.data.msg, \'提示\', {\n            type: \'error\'\n          });\n        }\n      })\n      .catch(err => {\n        alert(err);\n      })\n  },\n  watch: {\n    index () {\n      this.init();\n    }\n  }\n}\n<\/script>\n<style scoped>\n.shuju {\n  margin-top: 16px;\n  font-size: 16px;